INSERT INTO `tbl_home_body` (`home_body_id`, `bn_body_header`, `en_body_header`, `bn_body_text`, `en_body_text`) VALUES
(1, ' দক্ষতা উন্নয়ন', 'SKILLS DEVELOPMENT', 'বিশ্বের দ্রুততম ক্রমবর্ধমান অর্থনীতিতে বসবাসের পাশাপাশি বাংলাদেশের তরুণরা একটি অনিশ্চিত ভবিষ্যতের মুখোমুখি হয়। বাংলাদেশের জনসংখ্যার এক তৃতীয়াংশ জনসংখ্যার 10 থেকে ২4 বছর বয়সী এবং 2.2 মিলিয়ন তরুণরা প্রতিবছর তার কর্মীবাহিনীতে প্রবেশ করে। প্রতি চারজন ব্যবসায়ীর তিনজন রিপোর্ট করেন যে দক্ষ শ্রমিকরা অপেক্ষাকৃত দুর্বল, যদিও প্রায় 10 মিলিয়ন জনগোষ্ঠী বর্তমানে বেকার বা কম কর্মহীন।', 'Young people in Bangladesh face a precarious future, despite living in one of the world’s fastest growing economies. A third of Bangladesh’s population is 10-24 years old and 2.2 million young people enter its workforce every year. Three out of every four business leaders report that skilled workers are scarce, while approximately ten million young people are currently unemployed or underemployed.');
