(2, 'আমাদের প্রশিক্ষক কে?', 'Who are our trainers', 'পল্লী অঞ্চলের বাসিন্দাদের বাসস্থান এবং নিখরচায় এবং নিখরচায় বসবাস করে', 'Pellentesque habitant morbi tristique senectus et netus et malesuada', 'upload/tab_image/_MG_9963web.jpg'),
(3, 'আমাদের প্রশিক্ষণার্থীরা কে?', 'Who are our trainees?', 'পল্লী অঞ্চলের বাসিন্দাদের বাসস্থান এবং নিখরচায় এবং নিখরচায় বসবাস করে', 'Pellentesque habitant morbi tristique senectus et netus et malesuada', 'upload/tab_image/image-5.jpg');
