INSERT INTO `tbl_notice` (`notice_id`, `bn_notice_header`, `en_notice_header`, `bn_notice_text`, `en_notice_text`, `image`, `post_date`, `status`) VALUES
(2, 'দক্ষ মেয়ে প্রভাব', 'The skilled girl effect', 'বাংলাদেশে একটি বিশৃঙ্খল রাজধানী ঢাকার একটি ছোট দোকানের জীবন থেকে একটি কম্পিউটার ভাইরাস। রিক্সা চালকের বাইরের ভাড়া এবং রাস্তার বিক্রেতার জন্য বাইরের দিনগুলি মাছের দামের কথা বলে। ফোনটি বাজছে. হাসনা হেনা, 15, এক হাতে কল নেয়, তার অন্যান্য ফটোশপ খুলতে ট্র্যাক প্যাড উপর উড়ন্ত। এটি একটি নতুন ক্লায়েন্ট যা একটি পোস্টার নকশা প্রয়োজন।\r\nটঙ্গীর গ্রামীণ শহরে এক ঘন্টা দূরে, মাহমুদা আক্তার (16) মূল বাজারে একটি মোবাইল ফোন সার্ভিসিং দোকানে বসে আছে। একটি তাত্ত্বিত খুঁজছেন গ্রাহক তার ফোন সঙ্গে rushes একটি ছোট স্ক্রু ড্রাইভার হোল্ডিং, মাহমুদা তার মোবাইলের কভার খুলুন এবং সমস্যার নির্ণয়।\r\nরাজশাহীর উপকন্ঠে ঢাকার ছয় ঘণ্টা খাদিজা আক্তার 18 বছর বয়সে চকচকে লাল ও কালো মোটরসাইকেল চালায়। \"এখন সবকিছু ঠিকঠাক করা উচিত,\" তিনি মালিককে বলছেন। তিনি ধুলোর মেঘে অদৃশ্য হয়ে যাওয়া ব্লকের চারপাশে একটি পরীক্ষা যাত্রার জন্য এটি নিক্ষেপ করেন।\r\nখুব অল্প সময়ের জন্য এটি একটি যুবতী একটি গ্রাফিক ডিজাইনার, একটি ফোন সেবা প্রদানকারী, বা একটি মেকানিক হতে জন্য এটি অস্বাভাবিক ছিল - বিশেষ করে একটি দেশে যেখানে কয়েকটি মহিলা ড্রাইভ।\r\nনারী আনুষ্ঠানিকভাবে বাংলাদেশে আনুষ্ঠানিক কর্মিবৃন্দের নতুন প্রবেশকারী এবং এই নতুন জনসংখ্যার অধিকাংশই তাদের পরিবারের প্রথম চাকরির জন্য। দেশ জুড়ে, নারীরাও নেতৃত্বের অবস্থানের দিকে এগিয়ে যাচ্ছে, যা দেশের কর্মশক্তির জন্য তীব্র প্রভাব রয়েছে।\r\nবিশ্বব্যাংকের প্রধান অপারেটিং অফিসার ও ব্যবস্থাপনা পরিচালক শ্রীমূল্যানি ইন্নাভাতি বলেছেন, এক দশকেরও বেশি সময় ধরে বাংলাদেশের অবস্থান 80 শতাংশেরও বেশি হবে। বিশ্বব্যাংকের প্রধান অপারেটিং অফিসার ও ব্যবস্থাপনা পরিচালক মো।\r\nঅর্থনৈতিক ক্ষমতায়নের গল্প দ্রুত পরিবর্তিত হচ্ছে। ইউএসএআইডি-তহবিলের একটি গবেষণায় দেখানো হয়েছে যে, বাংলাদেশের পোশাক শ্রমিকদের ২0-২4 বছর বয়সী মেয়েদের মধ্যে গত 10 বছরে দ্বিগুণ মাত্রা বেড়েছে। শিল্প এখন দেশে চার মিলিয়ন কর্মী নিয়োগ, তাদের 80 শতাংশ নারী গত বছর ২4 বিলিয়ন ডলারের গার্মেন্টস রপ্তানির পরিমাণ ছিল, বাংলাদেশের মোট রপ্তানিের 80 শতাংশ।\r\nম্যাকিনসি গ্লোবাল ইনস্টিটিউট থেকে একটি নতুন প্রতিবেদনে ইঙ্গিত দেয় যে, যদি পুরুষের মতো একই চাকরির সুযোগ দেওয়া হয়, তবে নারীরা ২8 ট্রিলিয়ন ডলারকে বিশ্ব অর্থনৈতিক প্রবৃদ্ধিতে অবদান রাখতে পারে। যে মার্কিন যুক্তরাষ্ট্র এবং চীনা অর্থনীতি মিলিত প্রায় সমতুল্য।\r\nদেশে নারীর সমতা বিকাশ কেন নৈতিক কারণ রয়েছে, তবে অর্থনৈতিক কারণও আছে। নারী স্বাস্থ্য, শিক্ষা, এবং ভবিষ্যতে বিনিয়োগে তাদের উপার্জন ব্যয় সম্ভবত। নারীর ক্ষমতায়ন প্রতিটি নতুন টেকসই উন্নয়ন লক্ষ্যের একটি গুরুত্বপূর্ণ উপাদান। কিন্তু লিঙ্গ সমতার জন্য সমর্থন ছাড়াই, কর্মসংস্থানের ক্ষেত্রে নারীর অংশগ্রহণও অর্থনৈতিক অর্থের সৃষ্টি করে।', 'A computer whirs to life in a small shop in Bangladesh’s chaotic capital Dhaka. Outside rickshaw drivers bargain for fares and street sellers call out the day’s fish prices. The phone rings. Hasna Hena, 15, takes the call in one hand, her other flying over the track pad to open Photoshop. It’s another new client needing a poster design.\r\nAn hour away in the rural town of Tongi, Mahmuda Akhter, 16, sits in a mobile phone servicing shop in the main market. A stressed looking customer rushes in with his phone. Holding a small screwdriver, Mahmuda pries open the cover of his mobile and diagnoses the problem.\r\nIn the outskirts of Rajshahi, six hours from Dhaka, Khadija Akhter, 18, kick-starts a shiny red and black motorcycle she has just fixed. “Everything should be fine now,” she tells the owner. She jumps on to take it for a test ride around the block, disappearing in a cloud of dust.\r\nNot so long ago it would have been unusual for a young woman to be a graphic designer, a phone service provider, or a mechanic – especially in a country where few women drive.\r\nWomen are relatively new entrants to the formal workforce in Bangladesh and the majority of this new demographic are the first in their families to have a job. Across the country, women are increasingly taking up leadership positions as well, which has tremendous implications for the country’s workforce.\r\nIf Bangladesh stays on track, more than 80 percent of women will be working in a decade’s time – up from a third at the moment, says the World Bank’s Chief Operating Officer and Managing Director Sri Mulyani Indrawati.\r\nThe story of economic empowerment is rapidly changing. A USAID-funded study showed that labour force participation for 20- to 24-year-old women in Bangladesh more than doubled over the past 10 years, coinciding with the garment boom. The industry now employs over four million workers in the country, 80 percent of them women. Garment exports accounted for $24 billion last year, 80 percent of Bangladesh’s total exports. \r\nA new report from The McKinsey Global Institute indicates that if given the same job opportunities as men, women could contribute $28 trillion to global economic growth. That is roughly equivalent to the US and Chinese economies combined.\r\nThere are moral reasons why countries should foster gender equality, but there are economic reasons as well. Women are more likely to spend their earnings on health, education, and investing in the future. Empowering women is also a critical component of each new sustainable development goal. But beyond advocating for gender equality, women’s participation in the workforce also makes economic sense.', 'upload/notice_image/tabb.png', '2017-09-10', 1);
