INSERT INTO `tbl_slider` (`slider_id`, `bn_slider_header`, `en_slider_header`, `bn_slider_text`, `en_slider_text`, `image`, `status`) VALUES
(3, 'বাংলা-কবিতা ডট কম', 'The sound of the thunder', 'বাংলা-কবিতা ডট কম ওয়েবসাইটটি বর্তমান সময়ে বাংলা কবিতার সবচেয়ে জনপ্রিয় ও সমৃদ্ধ ওয়েব পোর্টাল। এ প্রজন্মের শতাধিক কবি আমাদের কবিতার আসরে প্রতিদিন কবিতা .', 'The sound of the thunder, shudders, the stars that light up the poor man\'s sky, affirms, and the rain that brings the soul back from past, long lost from the days of', 'upload/slider_image/dws-irc-brac-wash-meeting-770px.jpg', 0),
(4, 'ওয়াত ইস লড়ামু ইপসম?', 'Pellentesque habitant morbi tristique senectus', 'বাংলা সব অক্ষর রাখার একটা চেষ্টা ছিল। কিন্তু তা ব্যর্থ – আমি শেষে এই চেষ্টা করাটাকেই অপ্রয়োজনীয় মনে করলাম। এ-তো আর বাংলা ভাষার আগার হচ্ছে না, এ হলো পরম্পরাহীন, কিংবা তাৎপর্যপূর্ণ একটি লেখা, যা ', 'Pellentesque habitant morbi tristique senectusPellentesque habitant morbi tristique senectusPellentesque habitant morbi tristique senectusPellentesque habitant morbi tristique senectusPellentesque hab', 'upload/slider_image/template-mac2.jpg', 0),
(5, 'অগ্রগতি সম্পর্কে', 'About PROGRESS', 'ব্র্যাক এসডিপি প্রোগ্রামটি টেকসই দক্ষতার উন্নয়ন (অগ্রগমন) এর মাধ্যমে গ্রামীণ উদ্যোক্তাদের প্রো-দরিদ্র উন্নয়ন নামক একটি নতুন প্রকল্প চালু করেছে। এই প্রকল্পটির সামগ্রিক উদ্দেশ্য হলো গ্রামীণ এলাকায় মাইক্রো এবং কুটিরশিল্প উন্নয়ন, দক্ষ উদ্যোক্তাদের দ্বারা পরিচালিত এবং দক্ষ শ্রমিক নিয়োগ করা, বাংলাদেশে 42 টি জেলার হালকা ইঞ্জিনিয়ারিং খাতে কার্যকর ও টেকসই বাজারে অবদানের জন্য। এই ইউরোপীয় ইউনিয়ন দ্বারা পরিচালিত 36 মাস প্রকল্প', 'BRAC SDP programme has launched a new project named PRO-poor Growth of Rural Enterprises through Sustainable Skills-development (PROGRESS). The overall objective of this project is to enhanced the development of micro and cottage enterprises at the rural areas, managed by skilled entrepreneurs and employing skilled workers, contributing to effective and sustainable markets in the light engineering sector in 42 districts in Bangladesh. This is 36 months project funded by the European Union. ', 'upload/slider_image/slider1.jpg', 1),
(6, 'বাংলাদেশের ইঞ্জিনিয়ারিং সেক্টর সম্পর্কে', 'About Light Engineering Sector of Bangladesh', 'লাইট ইঞ্জিনিয়ারিং সেক্টর (এলইএস) অন্য সব শিল্পের মতে শিল্প হিসেবে স্বীকৃত, কারণ তারা মূলধন যন্ত্রপাতি, খুচরা যন্ত্রাংশ এবং আনুষাঙ্গিক শিল্পের মৌলিক উপাদানগুলি সরবরাহ করে, যা আন্তর্জাতিক বাজারে রপ্তানি করার জন্য উচ্চতর সম্ভাবনা সহ গার্হস্থ্য বাজারের চাহিদা মেটাচ্ছে।\r\nলাইট ইঞ্জিনিয়ারিং সেক্টর (এলইএস) বাংলাদেশের একটি গুরুত্বপূর্ণ সেক্টর হিসেবে স্বীকৃত হয়েছে যা অর্থনৈতিক উন্নয়নে গুরুত্বপূর্ণ ভূমিকা পালন করতে সক্ষম এবং কর্মসংস্থান সৃষ্টির ব্যাপক সুযোগ রয়েছে।', 'The Light Engineering Sector (LES) recognized as the mother industry of all other industries as they supply the basic elements of an industry, like capital machinery, spare parts and accessories to meeting the demand of domestic market with high potentiality to export in international market. \r\nThe Light Engineering Sector (LES) has recognized as an important sector of Bangladesh that has potency to play a significant role in the economic development along with a vast scope of employment generation.', 'upload/slider_image/slider2.jpg', 1);
